import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
  table: {
    minWidth: 350,
  },
  tableContainer: {
      opacity: 0.9,
  }
});

function createData(name, calories, fat, carbs, protein) {
  return { name, calories, fat, carbs, protein };
}

const rows = [
  createData('AVG', 159, 6.0, 24, 4.0),
  createData('B365', 237, 9.0, 37, 4.3),
  createData('bwin', 262, 16.0, 24, 6.0),
  createData('WH', 305, 3.7, 67, 4.3),
  createData('PS', 356, 16.0, 49, 3.9),
];

export default function TableComponent() {
  const classes = useStyles();

  return (
    <TableContainer className={classes.tableContainer} component={Paper}>
      <Table className={classes.table} aria-label="simple table">
        <TableHead>
          <TableRow>
            <TableCell><b>Bookie</b></TableCell>
            <TableCell align="right"><b>1x</b></TableCell>
            <TableCell align="right"><b>x</b></TableCell>
            <TableCell align="right"><b>2x</b></TableCell>
            <TableCell align="right"><b>O 2.5</b></TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.name}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.calories}</TableCell>
              <TableCell align="right">{row.fat}</TableCell>
              <TableCell align="right">{row.carbs}</TableCell>
              <TableCell align="right">{row.protein}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
}
